import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./App";
// import Home from "./pages/Home/Home";
// import About from "./pages/About/About";
// import Event from "./pages/Event/Event";
// import Faq from "./pages/Faq/Faq";
// import Contact from "./pages/Contact/Contact";
// import Terms from "./pages/termsandcon/Terms";
// import Privacy from "./pages/privpolicy/Privacy";
// import DashBoard from "./pages/Dashboard/DashBoard";
// import AppHouse from "./house/AppHouse";
// import AdminEve from "./AdminPage/AdminEve";
// import Quiz from "./pages/quiz/Quiz";
// // import indexon from './indexon'
// import { UserAuth } from "./auth/UserAuth";
// import { AdminAuth } from "./auth/AdminAuth";
// import Hack1 from "./pages/Home/Hack1";
// import Hack2 from "./pages/Home/Hack2";
// import Hack3 from "./pages/Home/Hack3";

const AppRoutes = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<App />} />
          <Route path='/User' element={<UserAuth />}>
            <Route path="Home" element={<Home />} />
            <Route path="About" element={<About />} />
            <Route path="Event" element={<Event />} />
            <Route path="Contact" element={<Contact />} />
            <Route path="Faq" element={<Faq />} />
            <Route path="Terms" element={<Terms />} />
            <Route path="Privacy" element={<Privacy />} />
            <Route path="DashBoard" element={<DashBoard />} />
            <Route path="AppHouse" element={<AppHouse />} />
            <Route path="indexon" element={<indexon />} />
            <Route  path="Hack1" element={<Hack1 />} />
            <Route  path="Hack2" element={<Hack2 />} />
            <Route  path="Hack3" element={<Hack3 />} />
            <Route  path="Quiz" element={<Quiz />} />
          </Route>

          <Route path="/Admin" element={<AdminAuth />}>
            <Route path="AdminEve" element={<AdminEve />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </>
  );
};

export default AppRoutes;
